from math import pi, e

def fft(P):
    n = len(P) 
    if n == 1: 
        return P 
    w = pow(e, 2 * pi * complex(0, 1) / n) 
    Pe, Po = P[::2], P[1::2] 
    ye, yo = fft(Pe), fft(Po) 
    y = [0] * n 
    for j in range(n // 2): 
        y[j] = ye[j] + pow(w, j) * yo[j] 
        y[j + n // 2] = ye[j] - pow(w, j) * yo[j] 
    return y 

def ifft(P):
    n = len(P) 
    if n == 1: 
        return P 
    w = pow(e, -2 * pi * complex(0, 1) / n) 
    Pe, Po = P[::2], P[1::2] 
    ye, yo = ifft(Pe), ifft(Po) 
    y = [0] * n 
    for j in range(n // 2): 
        y[j] = ye[j] + pow(w, j) * yo[j] 
        y[j + n // 2] = ye[j] - pow(w, j) * yo[j] 
    return y

